def transform(sequence):
    zero_index = sequence.index('0')
    non_zero_index = sequence.index('0', zero_index + 1)
    new_sequence = list(sequence)
    new_sequence[zero_index], new_sequence[non_zero_index] = new_sequence[non_zero_index], new_sequence[zero_index]
    return ''.join(new_sequence)

def transform(sequence):
    seq_list = list(sequence)
    zero_count = seq_list.count('0')
    seq_list = [x for x in seq_list if x != '0']
    return '0' * zero_count + ''.join(seq_list)
